import React from 'react';


  export default function List(props) {
    //    console.log(props.list);
       let lista = props.list;
    return (
        <div>
          <h2>List</h2>
         {lista.map( ( {user, title} ) => {
    return <p key={user}>{user} - {title}</p>
})}
        </div>
    );
}
